import { Redirect, Route } from 'react-router-dom'

const PrivareRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) => {
        localStorage.getItem('authToken') ? (
          <Component {...props} />
        ) : (
          <Redirect to='/login' />
        )
      }}
    />
  )
}

export default PrivareRoute
